  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetry of Lakes Michigan, Erie, Saint
  Clair, Ontario and Huron has been compiled as a component of a NOAA project to rescue
  Great Lakes lake floor geological and geophysical data and make it more accessible.
  Lake Superior bathymetry partially completed. The present contours and grids have
  been partially derived and completely compiled here at NOAA's National Geophysical
  Data Center (NGDC) using a variety of sources of data including the NOS Hydrographic
  data base and the Canadian Hydrographic Service (CHS) smooth sheets. This project
  is a cooperative effort between investigators at the NGDC, the NOAA Great Lakes
  Environmental Research Laboratory and the Canadian Hydrographic Service. Bathymetric
  data used for this project have been collected from the Great Lakes in support of
  nautical charting for at least 150 years by the US Army Corp. of Engineers (before
  1970), the NOAA National Ocean Service (after 1970), and the CHS.\",\n\t\"license_title\":
